    private async Task LoadRooms()
    {
        Rooms = await HotelRoomService.GetHotelRooms(HomeVM.StartDate.ToString("MM/dd/yyyy"), HomeVM.EndDate.ToString("MM/dd/yyyy"));

        foreach (var room in Rooms)
        {
            room.TotalAmount = room.RegularRate * HomeVM.NoOfNights;
            room.TotalDays = HomeVM.NoOfNights;
        }
    }

    private async Task SaveBookingInfo()
    {
        IsProcessing = true;
        HomeVM.EndDate = HomeVM.StartDate.AddDays(HomeVM.NoOfNights);
        await LocalStorge.SetItemAsync(SD.Local_InitialBooking, HomeVM);
        await LoadRooms();
        IsProcessing = false;
    }

